const App = () => {
  const [inputData, setInputData] = useState("");
  return (
    <>
      <div>
        <h1>Add Your Items Here</h1>
        <input
          type="text"
          placeholder="Add Items"
          value={inputData}
          onChange={(e) => setInputData(e.target.value)}
        />
        <button>+</button>
      </div>
      <div>
        <h2>Apple</h2>
        <button>-</button>
      </div>
    </>
  );
};

export default App;
